import React from "react";
import "./styles/menuv2.css";
import cards from "../media/cardss.png";
import tips from "../media/blog.png";
import LeaderBoard from "./LeaderBoard";
import { Link } from "react-router-dom";
import { useState } from "react";
const MenuV2 = () => {
  const [isBoard, setIsBoard] = useState(false);
  const hideLeaderboard = () => {
    setIsBoard(false);
  };
  const handleLeaderboard = () => {
    isBoard ? setIsBoard(false) : setIsBoard(true);
  };
  return (
    <>
      <div className="container-menus">
        <div onClick={handleLeaderboard} className="menu-option one">
          <div className="container-img-txt">
            <img src={cards} alt="" />

            <LeaderBoard
              hideLeaderboard={hideLeaderboard}
              isBoard={isBoard}
            ></LeaderBoard>
            <h1>Puntajes</h1>
          </div>
        </div>

        <Link to="/cards" className="link-menu">
          <div className="menu-option two">
            <div className="container-img-txt">
              <img src={cards} alt="" />
              <h1>Cartas</h1>
            </div>
          </div>
        </Link>
        <Link to="/posts" className="link-menu">
          <div className="menu-option three">
            <div className="container-img-txt">
              <img src={tips} alt="" />
              <h1>blog</h1>
            </div>
          </div>
        </Link>
      </div>
    </>
  );
};

export default MenuV2;
